/**
	Play logon mp3!
*/
void play_logon(void)
{
	/* Variables. */
	uint16_t i;
//	uint16_t j;
	int k;
	uint8_t buf[32];
	
	/* Disable interrupts. */
//	cli();
	
	/* Write some blank data to vs1001. */
	for (i = 0; i < 1024; i++)
	{
		sdi_w_vs1001(0);
	}
	
	/* Start playing. */
	for (i = 0; i < (32 * 375); i += 32)
	{
		/* Read 32 bytes of data. */
		memcpy_P(buf, logon_mp3 + i, 32);
		
		/* Wait for DREQ go high. */
		while (bit_is_clear(PINB, PB4));
		
		/* Write data. */
		for (k = 0; k < 32; k++)
		{
			sdi_w_vs1001(buf[k]);
		}
	}
	
	/* Set volume to zero. */
//	spi_wcmd_vs1001(VS1001_VOLUME, 0xfe, 0xfe);

	/* Write some blank data to vs1001. */
	for (i = 0; i < 2048; i++)
	{
		sdi_w_vs1001(0);
	}
	
	/* Reset vs1001. */
//	spi_sreset_vs1001();
//	spi_wcmd_vs1001(VS1001_VOLUME, 0xfe, 0xfe);
	
	/* Enable interrupts. */
//	sei();
}
